        &:disabled {
          color: c.color('gray', 300);
          background-color: c.$white;
          border-color: c.color('gray', 100);
        }
      }
    }
  }

  &[hierarchy='tertiary'] {
    padding: 0;

    @each $color in $colors {
      &[color='#{$color}'] {
        color: c.color($color, 500);
        background-color: transparent;
        border-color: transparent;

