          this.usFlag.size = LIST_TILE_SIZE_TO_US_FLAG_SIZE[size];
        })
    );
    this.sub$.add(
      this.parent.avatarTypeChanged$
        .pipe(startWith(this.parent.avatarType))
        .subscribe(() => {
          if (!this.flag) {
            return;
          }

          this.flag.type = this.parent.avatarType;
        })
    );
  }

  ngOnDestroy(): void {
    this.sub$.unsubscribe();
  }
}

